import React from "react";
import { connect } from "react-redux";
import { JobType, JobsState, selectJobsList } from "../redux/jobSlice";
import { AppDispatch, RootState } from "../redux/store";

const JobContainer: React.FC<JobsState> = (props: JobsState) => {
  const { list } = props;
  console.log(list);
  return (
    <>
      {list.map((item: JobType, idx: number) => (
        <div className="container">
          <img className="image"></img>
          <h1>{item.title}</h1>
        </div>
      ))}
    </>
  );
};

const mapStatetoProps = (state: RootState) => ({
  list: selectJobsList(state),
});

const mapDispatchToProps = (dispatch: AppDispatch) => ({});

export default connect(mapStatetoProps, mapDispatchToProps)(JobContainer);
